import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";
import "./Services.css";

function MbbsRussia() {
  return (
    <section>
			<div className="service__bg">
				<h1 className="service__title">MBBS In Russia</h1>
			</div>
			<div>
				<img className="service__image" src="/assets/images/service-image/study-mbbs-russia.png" alt="Study In Russia"/>
			</div>
			<Container>
				<div>
					<p>Russia is well-acclaimed among international students for providing top-notch education facilities and has been amassing huge numbers of students the past few decades. The medical courses offered in Russia are recognized by the 5 renowned international medical councils namely the WHO, FAIMER, IMED, MCI, WFME and also by the Medical Council of leading countries like U.S.A, U.K, the Middle East, Australia, India, and Canada. Also, medical universities in Russia offer students, subsidized education along with scholarship. This subsidized fee is provided by the Russian Ministry of Health & Education. High quality of education along with the low cost of tuition fee is one of the main reasons for choosing the top medical universities in Russia for MBBS. Students and teachers are divided into batches of the ratio 15:2. Later, they are taught the local language and split into a ratio of 7:1. Also, about 12 of these universities provide MBBS in English medium. The graduates from Russian Medical Universities are presently working in leading hospitals across the world. Duration of MBBS in Russia in English Medium is 6 years (5+1). Students also can choose MBBS in Russian Medium, of which the duration is 7 years which incorporates one year for Russian language training</p>
				</div>
			</Container>
    </section>
  );
}

export default MbbsRussia;
